import { useState } from "react";

const Tasks = () => {
  const [tasks, setTasks] = useState([
    {
      id: 1,
      text: "Garbage",
      day: "Feb 5th at 3:00pm",
      reminder: false,
    },
    {
      id: 2,
      text: "shopping",
      day: "Feb 8th at 3:00pm",
      reminder: false,
    },
    {
      id: 3,
      text: "clean",
      day: "Feb 6th at 3:00pm",
      reminder: true,
    },
  ]);

  return (
    <>
      {tasks.map((task) => (
        <h3 key={task.id}>{task.text}</h3>
      ))}
    </>
  );
};

export default Tasks;
